import './App.css';
import Login from './components/Login';
import RegisterUser from './components/RegisterUser';
import RoutesApp from './routes/RoutesApp';

function App() {
  return (
    <div>
      <AppBar position='static'><Toolba>Space Travels</Toolba> </AppBar>
      <Container>
        <RoutesApp></RoutesApp>
      </Container>
    </div>
  );
}

export default App;
